private boolean hasMultipleLinesBefore(DetailAST ast) {
    boolean result = false;
    if ((ast.getType() != TokenTypes.VARIABLE_DEF
        || isTypeField(ast))
            && hasNotAllowedTwoEmptyLinesBefore(ast)) {
        result = true;
    }
    return result;
}
